document.getElementById("gerar").addEventListener("click", function () {
    const nome = document.getElementById("nome").value;
    const telefone = document.getElementById("telefone").value;
    const cargo = document.getElementById("cargo").value;

    if (!nome || !telefone || !cargo) {
        alert("Preencha todos os campos!");
        return;
    }

    const logoBase64 = "data:image/png;base64,"; 

    const assinaturaHTML = `
  <table role="presentation" cellspacing="0" cellpadding="0" border="0" style="border-collapse: collapse; font-family: Arial, sans-serif;">
    <tbody>
        <tr>
            <td style="padding-right: 10px; vertical-align: middle;">
                <img src="${logoBase64}" alt="Logo" width="130" style="display: block;">
            </td>

            <td style="width: 2px; vertical-align: middle;">
                <table role="presentation" cellspacing="0" cellpadding="0" border="0" style="width: 100%; height: 100%;">
                    <tr>
                        <td style="width: 2px; height: 50px; background-color: black;"></td>
                    </tr>
                </table>
            </td>

            <td style="padding-left: 10px; vertical-align: middle;">
                <p style="margin: 0; font-weight: bold; font-size: 16px; font-family: monospace;">${nome}</p>
                <p style="margin: 0; font-size: 14px; color: gray; font-family: monospace;">${cargo}</p>
                <p style="margin: 0; font-size: 14px; color: black; font-family: monospace;">${telefone}</p>
            </td>
        </tr>
    </tbody>
</table>
    `;



    document.getElementById("resultado").innerHTML = assinaturaHTML;
});

document.getElementById("baixar").addEventListener("click", function () {
    const assinatura = document.getElementById("resultado").innerHTML;

    if (!assinatura || assinatura.trim() === "") {
        alert("Visualize a assinatura antes de baixar!");
        return;
    }

    const htmlCompleto = `
        <!DOCTYPE html>
        <html lang="pt-br">
        <head>
            <meta http-equiv="Content-Type" content="text/html; charset=UTF-8">
            <title>Assinatura</title>
        </head>
        <body style="margin: 0; padding: 0; font-family: Arial, sans-serif;">
            ${assinatura}
        </body>
        </html>
    `;

    // Cria um blob com o contedo HTML
    const blob = new Blob([htmlCompleto], { type: 'text/html' });
    const url = URL.createObjectURL(blob);

    // Cria um link temporrio para download
    const a = document.createElement('a');
    a.href = url;
    a.download = 'assinatura.html';
    document.body.appendChild(a);
    a.click();

    // Remove o link temporrio
    document.body.removeChild(a);
    URL.revokeObjectURL(url);
});